import React from 'react'
import './Tree.css';


const TreeItem = ({item, openNode}) => 
        <div className="tree_node" style={{paddingLeft: '20px', cursor: 'pointer'}}>
            <h4 onClick={() => openNode(item.id)}>{item.title}</h4>
            {item.items && item.state === true ? <Tree items={item.items} openNode={openNode}/> : null}
        </div>




const Tree = ({items, openNode}) => <div>
    {items.map((i, key) => <TreeItem  key={key} item={i} openNode={openNode}/>)}    
</div>


export default Tree;
